// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import '@openzeppelin/contracts/token/ERC1155/ERC1155.sol';
import './AfenToken.sol';
// deployed contract address
// 0xD434fc96112d3dB4B676aFB99b9D67dE73A34638

contract AfenNft is ERC1155{    

	address owner;
	struct Nft {
		string _hash;
		uint _aprice;
		uint _bprice;
		address _creator;
		bool _sell; // True: Be going to sell.       False: Not sell
	}
	Nft[] nft_list;
	AfenToken atoken = new AfenToken();

	event Minted(string _hash, uint _aprice, uint _bprice, address _creator, bool _sell);
	event AddedSell(uint _id, string _hash, uint _aprice, uint _bprice, address _creator, bool _sell);
	constructor() ERC1155("") {}

	modifier onlyOwner {
		require(msg.sender == owner);
		_;
	}

	receive() payable external {}

	function withdraw() onlyOwner public {
		payable(this).transfer(address(this).balance);
	}

	function mint(string memory _hash, uint _aprice, uint _bprice, uint _amount) public returns (bool){
		uint id = nft_list.length;
		_mint(msg.sender, id, _amount, "");
		Nft memory temp = Nft(_hash, _aprice, _bprice, msg.sender, false);
		nft_list.push(temp);
		emit Minted(_hash, _aprice, _bprice, msg.sender, false);
		return true;
	}
	function calc_fee(uint _amount) public pure returns (uint) {
		return _amount * 8 / 100;
	}
	function sell(uint _id, uint token_kind) public returns (bool) {
		nft_list[_id]._sell = true;
		uint list_fee;
		if(token_kind == 0) {
			list_fee = calc_fee(nft_list[_id]._aprice);
			atoken.transfer(address(this), list_fee);	
		} else {
			list_fee = calc_fee(nft_list[_id]._bprice);

		}
		emit AddedSell(_id, nft_list[_id]._hash, nft_list[_id]._aprice, nft_list[_id]._bprice, nft_list[_id]._creator, nft_list[_id]._sell);
		return true;
	}

	function cancelSell(uint _id) public returns (bool) {
		nft_list[_id]._sell = false;
		return true;
	}
}
